import React from 'react';
import logo from './logo.svg';
import logo1 from '../public/logo_oficial.png' // relative path to image 
import './App.css';

function App() {
  return (
    <div className="App">

      <img src={logo1} className="" alt="logo" />

    </div>
  );
}

export default App;
